import React from "react";

function FileTree({ nodes, onPreview }) {
  return (
    <ul>
      {nodes.map((node) => (
        <li key={node.file_id}>
          {node.mime_type === "application/vnd.google-apps.folder" ? (
            <strong>üìÅ {node.name}</strong>
          ) : (
            <span
              style={{ cursor: "pointer", color: "blue" }}
              onClick={() => onPreview && onPreview(node.file_id)}
            >
              üìÑ {node.name}
            </span>
          )}
          {node.children && node.children.length > 0 && (
            <FileTree nodes={node.children} onPreview={onPreview} />
          )}
        </li>
      ))}
    </ul>
  );
}

export default FileTree;
